import React, { useState } from "react";

function AllColction() {
  const [AllColction, setAllColction] = useState("Kamkala");
  return (
    <div>
      <select
      value={AllColction}
      name="Kamkala"
      onChange={(e) => {
        setAllColction(e.target.value);
        effectCalled.current = false;
      }}
      >
        <option value="Kamkala">Kamkala</option>
        <option value="Omcreation">Omcreation</option>
        <option value="Bollywood">Bollywood</option>
        <option value="Celebrity">Celebrity</option>
        <option value="Kamkala">Kamkala</option>
        <option value="BNI">BNI</option>
        <option value="Cabinate">Cabinate</option>
        <option value="Freedom">Freedom</option>
        <option value="Galaxy">Galaxy</option>
        <option value="Art">Art</option>
        <option value="Media">Media</option>
        <option value="Modi">Modi</option>
      </select>
    </div>
  );
}

export default AllColction;
